  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112374 includes biological,
  chemical, discrete sample, physical and profile data collected from WAKATAKA MARU
  in the North Pacific Ocean from 1996-05-16 to 1996-05-25 and retrieved during cruise
  PACIFICA_49WA19960516 and WK9605. These data include ALKALINITY, CHLOROPHYLL A,
  DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE + NITRITE
  CONTENT (CONCENTRATION), NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE
  and pH. The instruments used to collect these data include CTD, Coulometer for DIC
  measurement and bottle. These data were collected by Shuichi Watanabe of Hokkaido
  University, Tsuneo Ono of National Research Institute of Fisheries Science and Ichiro
  Yasuda of Tokyo University as part of the PACIFICA_49WA19960516 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
